                WriteLiteral(@"    <script>
        function updateSubCategoryList() {
            var categorySelected = document.getElementById(""ddlGroupList"").value;

            $list = $('#GroupList');

            $.ajax({
                url: '/Admin/Group/GetGroup/' + categorySelected,
                type: 'GET',
                dataType: 'text',
                success: function(data) {
                    results = JSON.parse(data);
                    $list.html('');
